class Search extends Component {
  render() {
    return (
      <div>
        <form className="form">
          <input name="text" type="text" placeholder="search users.." />
          <input
            type="submit"
            className="btn btn-dark btn-block"
            value="Search"
          />
        </form>
      </div>
    );
  }
}

export default Search;
